import React from "react";
import styled from "styled-components";


const TimeSlot = ({onClick, index, time, isPossible}) => {
    if (isPossible) {
        return (
            <button style={{color:blue}} onClick={onClick} key={index} value={time} data-ispossible={isPossible}>
                {time.getMonth()}월 {time.getHours()}시 {time.getMinutes()}분
            </button>
        );
    } else {
        return (
            <button onClick={onClick} key={index} value={time} data-ispossible={isPossible}>impossible</button>
        );
    }

}

export default TimeSlot;
